import{_ as r,a,b as o,c as i,d,e as l,f as n}from"./chunks/arm_10pin_jtag_connector_pinout.BunWLrXM.js";import{_ as s,c as h,o as c,ab as e,m as t}from"./chunks/framework.CUflZczI.js";const T=JSON.parse('{"title":"3DR Pixhawk 1 Flight Controller (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/pixhawk.md","filePath":"en/flight_controller/pixhawk.md"}'),p={name:"en/flight_controller/pixhawk.md"},u=e('<h1 id="_3dr-pixhawk-1-flight-controller-discontinued" tabindex="-1">3DR Pixhawk 1 Flight Controller (Discontinued) <a class="header-anchor" href="#_3dr-pixhawk-1-flight-controller-discontinued" aria-label="Permalink to &quot;3DR Pixhawk 1 Flight Controller (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available. You can use the <a href="./../flight_controller/mro_pixhawk.html">mRo Pixhawk</a> as a drop-in replacement.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the manufacturer for support or compliance issues.</p></div><p>The <em>3DR Pixhawk<sup>®</sup> 1</em> autopilot is a popular general purpose flight controller based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv2</strong> open hardware design (it combines the functionality of the PX4FMU + PX4IO). It runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS.</p><p><img src="'+r+'" alt="Pixhawk Image"></p><p>Assembly/setup instructions for use with PX4 are provided here: <a href="./../assembly/quick_start_pixhawk.html">Pixhawk Wiring Quickstart</a></p><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to &quot;Key Features&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="http://www.st.com/web/en/catalog/mmc/FM141/SC1169/SS1577/LN1789" target="_blank" rel="noreferrer">STM32F427</a><ul><li>CPU: 180 MHz ARM<sup>®</sup> Cortex<sup>®</sup> M4 with single-precision FPU</li><li>RAM: 256 KB SRAM (L1)</li></ul></li><li>Failsafe System-on-Chip: STM32F100 <ul><li>CPU: 24 MHz ARM Cortex M3</li><li>RAM: 8 KB SRAM</li></ul></li><li>Wifi: ESP8266 external</li><li>GPS: u-blox<sup>®</sup> 7/8 (Hobbyking<sup>®</sup>) / u-blox 6 (3D Robotics)</li><li>Optical flow: <a href="./../sensor/px4flow.html">PX4 Flow unit</a></li><li>Redundant power supply inputs and automatic failover</li><li>External safety switch</li><li>Multicolor LED main visual indicator</li><li>High-power, multi-tone piezo audio indicator</li><li>microSD card for high-rate logging over extended periods of time</li></ul><p>Connectivity</p><ul><li>1x I2C</li><li>1x CAN (2x optional)</li><li>1x ADC</li><li>4x UART (2x with flow control)</li><li>1x Console</li><li>8x PWM with manual override</li><li>6x PWM / GPIO / PWM input</li><li>S.BUS / PPM / Spektrum input</li><li>S.BUS output</li></ul><h1 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h1><p>Originally manufactured by 3DR® this board was the original standard microcontroller platform for PX4®. While the board is no longer manufactured by 3DR, you can use the <a href="./../flight_controller/mro_pixhawk.html">mRo Pixhawk</a> as a drop-in replacement.</p><p>Order mRo Pixhawk from:</p><ul><li><a href="https://store.mrobotics.io/Genuine-PixHawk-1-Barebones-p/mro-pixhawk1-bb-mr.htm" target="_blank" rel="noreferrer">Bare Bones</a> - Just the board (useful as a 3DR Pixhawk replacement)</li><li><a href="https://store.mrobotics.io/Genuine-PixHawk-Flight-Controller-p/mro-pixhawk1-minkit-mr.htm" target="_blank" rel="noreferrer">mRo Pixhawk 2.4.6 Essential Kit</a> - includes everything except for telemetry radios</li><li><a href="https://store.mrobotics.io/product-p/mro-pixhawk1-fullkit-mr.htm" target="_blank" rel="noreferrer">mRo Pixhawk 2.4.6 Cool Kit! (Limited edition)</a> - includes everything you need including telemetry radios</li></ul><h2 id="specifications" tabindex="-1">Specifications <a class="header-anchor" href="#specifications" aria-label="Permalink to &quot;Specifications&quot;">​</a></h2><h3 id="processor" tabindex="-1">Processor <a class="header-anchor" href="#processor" aria-label="Permalink to &quot;Processor&quot;">​</a></h3><ul><li>32bit STM32F427 <a href="http://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M4" target="_blank" rel="noreferrer">Cortex-M4F</a> core with FPU</li><li>168 MHz</li><li>256 KB RAM</li><li>2 MB Flash</li><li>32 bit STM32F103 failsafe co-processor</li></ul><h3 id="sensors" tabindex="-1">Sensors <a class="header-anchor" href="#sensors" aria-label="Permalink to &quot;Sensors&quot;">​</a></h3><ul><li>ST Micro L3GD20H 16 bit gyroscope</li><li>ST Micro LSM303D 14 bit accelerometer / magnetometer</li><li>Invensense MPU 6000 3-axis accelerometer/gyroscope</li><li>MEAS MS5611 barometer</li></ul><h3 id="interfaces" tabindex="-1">Interfaces <a class="header-anchor" href="#interfaces" aria-label="Permalink to &quot;Interfaces&quot;">​</a></h3><ul><li>5x UART (serial ports), one high-power capable, 2x with HW flow control</li><li>2x CAN (one with internal 3.3V transceiver, one on expansion connector)</li><li>Spektrum DSM / DSM2 / DSM-X® Satellite compatible input</li><li>Futaba S.BUS® compatible input and output</li><li>PPM sum signal input</li><li>RSSI (PWM or voltage) input</li><li>I2C</li><li>SPI</li><li>3.3 and 6.6V ADC inputs</li><li>Internal microUSB port and external microUSB port extension</li></ul>',21),b=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/gCCC5A-Bvv4",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),m=e('<h3 id="power-system-and-protection" tabindex="-1">Power System and Protection <a class="header-anchor" href="#power-system-and-protection" aria-label="Permalink to &quot;Power System and Protection&quot;">​</a></h3><ul><li>Ideal diode controller with automatic failover</li><li>Servo rail high-power (max. 10V) and high-current (10A+) ready</li><li>All peripheral outputs over-current protected, all inputs ESD protected</li></ul><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p>Pixhawk can be triple-redundant on the power supply if three power sources are supplied. The three rails are: Power module input, servo rail input, USB input.</p><h3 id="normal-operation-maximum-ratings" tabindex="-1">Normal Operation Maximum Ratings <a class="header-anchor" href="#normal-operation-maximum-ratings" aria-label="Permalink to &quot;Normal Operation Maximum Ratings&quot;">​</a></h3><p>Under these conditions all power sources will be used in this order to power the system</p><ul><li>Power module input (4.8V to 5.4V)</li><li>Servo rail input (4.8V to 5.4V) <strong>UP TO 10V FOR MANUAL OVERRIDE, BUT AUTOPILOT PART WILL BE UNPOWERED ABOVE 5.7V IF POWER MODULE INPUT IS NOT PRESENT</strong></li><li>USB power input (4.8V to 5.4V)</li></ul><h3 id="absolute-maximum-ratings" tabindex="-1">Absolute Maximum Ratings <a class="header-anchor" href="#absolute-maximum-ratings" aria-label="Permalink to &quot;Absolute Maximum Ratings&quot;">​</a></h3><p>Under these conditions the system will not draw any power (will not be operational), but will remain intact.</p><ul><li>Power module input (4.1V to 5.7V, 0V to 20V undamaged)</li><li>Servo rail input (4.1V to 5.7V, 0V to 20V)</li><li>USB power input (4.1V to 5.7V, 0V to 6V)</li></ul><h2 id="schematics" tabindex="-1">Schematics <a class="header-anchor" href="#schematics" aria-label="Permalink to &quot;Schematics&quot;">​</a></h2><p><a href="https://raw.githubusercontent.com/PX4/Hardware/master/FMUv2/PX4FMUv2.4.5.pdf" target="_blank" rel="noreferrer">FMUv2 + IOv2 schematic</a> -- Schematic and layout</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>As a CC-BY-SA 3.0 licensed Open Hardware design, all schematics and design files are <a href="https://github.com/PX4/Hardware" target="_blank" rel="noreferrer">available</a>.</p></div><h2 id="connections" tabindex="-1">Connections <a class="header-anchor" href="#connections" aria-label="Permalink to &quot;Connections&quot;">​</a></h2><p>Pixhawk ports are shown below. These use Hirose DF13 connectors (predating the JST-GH connectors defined in the Pixhawk connector standard).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Many 3DR Pixhawk clones use Molex picoblade connectors instead of DF13 connectors. They have rectangular instead of square pins, and cannot be assumed to be compatible.</p></div><p><img src="'+a+'" alt="Pixhawk Connectors"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <code>RC IN</code> port is for RC receivers only and provides sufficient power for that purpose. <strong>NEVER</strong> connect any servos, power supplies or batteries to it or to the receiver connected to it.</p></div><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><h4 id="telem1-telem2-ports" tabindex="-1">TELEM1, TELEM2 ports <a class="header-anchor" href="#telem1-telem2-ports" aria-label="Permalink to &quot;TELEM1, TELEM2 ports&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>CTS (IN)</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>RTS (OUT)</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="gps-port" tabindex="-1">GPS port <a class="header-anchor" href="#gps-port" aria-label="Permalink to &quot;GPS port&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>CAN2 TX</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>CAN2 RX</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="serial-4-5-port" tabindex="-1">SERIAL 4/5 port <a class="header-anchor" href="#serial-4-5-port" aria-label="Permalink to &quot;SERIAL 4/5 port&quot;">​</a></h4><p>Due to space constraints two ports are on one connector.</p><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (#4)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (#4)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>TX (#5)</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>RX (#5)</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="adc-6-6v" tabindex="-1">ADC 6.6V <a class="header-anchor" href="#adc-6-6v" aria-label="Permalink to &quot;ADC 6.6V&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>ADC IN</td><td>up to +6.6V</td></tr><tr><td>3 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="adc-3-3v" tabindex="-1">ADC 3.3V <a class="header-anchor" href="#adc-3-3v" aria-label="Permalink to &quot;ADC 3.3V&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>ADC IN</td><td>up to +3.3V</td></tr><tr><td>3 (blk)</td><td>GND</td><td>GND</td></tr><tr><td>4 (blk)</td><td>ADC IN</td><td>up to +3.3V</td></tr><tr><td>5 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="i2c" tabindex="-1">I2C <a class="header-anchor" href="#i2c" aria-label="Permalink to &quot;I2C&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>SCL</td><td>+3.3 (pullups)</td></tr><tr><td>3 (blk)</td><td>SDA</td><td>+3.3 (pullups)</td></tr><tr><td>4 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="can" tabindex="-1">CAN <a class="header-anchor" href="#can" aria-label="Permalink to &quot;CAN&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>CAN_H</td><td>+12V</td></tr><tr><td>3 (blk)</td><td>CAN_L</td><td>+12V</td></tr><tr><td>4 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="spi" tabindex="-1">SPI <a class="header-anchor" href="#spi" aria-label="Permalink to &quot;SPI&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>SPI_EXT_SCK</td><td>+3.3</td></tr><tr><td>3 (blk)</td><td>SPI_EXT_MISO</td><td>+3.3</td></tr><tr><td>4 (blk)</td><td>SPI_EXT_MOSI</td><td>+3.3</td></tr><tr><td>5 (blk)</td><td>!SPI_EXT_NSS</td><td>+3.3</td></tr><tr><td>6 (blk)</td><td>!GPIO_EXT</td><td>+3.3</td></tr><tr><td>7 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="power" tabindex="-1">POWER <a class="header-anchor" href="#power" aria-label="Permalink to &quot;POWER&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>VCC</td><td>+5V</td></tr><tr><td>3 (blk)</td><td>CURRENT</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>VOLTAGE</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>GND</td><td>GND</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="switch" tabindex="-1">SWITCH <a class="header-anchor" href="#switch" aria-label="Permalink to &quot;SWITCH&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+3.3V</td></tr><tr><td>2 (blk)</td><td>!IO_LED_SAFETY</td><td>GND</td></tr><tr><td>3 (blk)</td><td>SAFETY</td><td>GND</td></tr></tbody></table><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>IO debug</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td></td><td></td></tr><tr><td>UART7</td><td>CONSOLE</td><td></td></tr><tr><td>UART8</td><td>SERIAL4</td><td></td></tr></tbody></table><h2 id="debug-ports" tabindex="-1">Debug Ports <a class="header-anchor" href="#debug-ports" aria-label="Permalink to &quot;Debug Ports&quot;">​</a></h2><h3 id="console-port" tabindex="-1">Console Port <a class="header-anchor" href="#console-port" aria-label="Permalink to &quot;Console Port&quot;">​</a></h3><p>The <a href="./../debug/system_console.html">PX4 System Console</a> runs on the port labeled <a href="#serial-4-5-port">SERIAL4/5</a>.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>A convenient way to connect to the console is to use a <a href="https://kb.zubax.com/display/MAINKB/Dronecode+Probe+documentation" target="_blank" rel="noreferrer">Dronecode probe</a>, as it comes with connectors that can be used with several different Pixhawk devices. Simply connect the 6-pos DF13 1:1 cable on the <a href="https://kb.zubax.com/display/MAINKB/Dronecode+Probe+documentation" target="_blank" rel="noreferrer">Dronecode probe</a> to the Pixhawk <code>SERIAL4/5</code> port.</p><p><img src="'+o+'" alt="Dronecode probe"></p></div><p>The pinout is standard serial pinout, designed to connect to a <a href="https://www.digikey.com/en/products/detail/TTL-232R-3V3/768-1015-ND/1836393" target="_blank" rel="noreferrer">3.3V FTDI</a> cable (5V tolerant).</p><table><thead><tr><th>3DR Pixhawk 1</th><th></th><th>FTDI</th></tr></thead><tbody><tr><td>1</td><td>+5V (red)</td><td></td></tr><tr><td>2</td><td>S4 Tx</td><td></td></tr><tr><td>3</td><td>S4 Rx</td><td></td></tr><tr><td>4</td><td>S5 Tx</td><td>5</td></tr><tr><td>5</td><td>S5 Rx</td><td>4</td></tr><tr><td>6</td><td>GND</td><td>1</td></tr></tbody></table><p>The wiring for an FTDI cable to a 6-pos DF13 1:1 connector is shown in the figure below.</p><p><img src="'+i+'" alt="Console Connector"></p><p>The complete wiring is shown below.</p><p><img src="'+d+'" alt="Console Debug"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For information on how to <em>use</em> the console see: <a href="./../debug/system_console.html">System Console</a>.</p></div><h3 id="swd-port" tabindex="-1">SWD Port <a class="header-anchor" href="#swd-port" aria-label="Permalink to &quot;SWD Port&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD</a> (JTAG) ports are hidden under the cover (which must be removed for hardware debugging). There are separate ports for FMU and IO, as highlighted below.</p><p><img src="'+l+'" alt="Pixhawk SWD"></p><p>The ports are ARM 10-pin JTAG connectors, which you will probably have to solder. The pinout for the ports is shown below (the square markers in the corners above indicates pin 1).</p><p><img src="'+n+'" alt="ARM 10-Pin connector pinout"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>All Pixhawk FMUv2 boards have a similar SWD port.</p></div><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v2_default</span></span></code></pre></div><h2 id="parts-housings" tabindex="-1">Parts / Housings <a class="header-anchor" href="#parts-housings" aria-label="Permalink to &quot;Parts / Housings&quot;">​</a></h2><ul><li><strong>ARM MINI JTAG (J6)</strong>: 1.27 mm 10pos header (SHROUDED), for Black Magic Probe: FCI 20021521-00010D4LF (<a href="https://www.distrelec.ch/en/minitek-127-straight-male-pcb-header-surface-mount-rows-10-contacts-27mm-pitch-amphenol-fci-20021521-00010d4lf/p/14352308" target="_blank" rel="noreferrer">Distrelec</a>, <a href="https://www.digikey.com/en/products/detail/20021521-00010T1LF/609-4054-ND/2414951" target="_blank" rel="noreferrer">Digi-Key</a>,) or Samtec FTSH-105-01-F-DV-K (untested) or Harwin M50-3600542 (<a href="https://www.digikey.com/en/products/detail/harwin-inc/M50-3600542/2264370" target="_blank" rel="noreferrer">Digikey</a> or <a href="http://ch.mouser.com/ProductDetail/Harwin/M50-3600542/?qs=%2fha2pyFadujTt%2fIEz8xdzrYzHAVUnbxh8Ki%252bwWYPNeEa09PYvTkIOQ%3d%3d" target="_blank" rel="noreferrer">Mouser</a>) <ul><li>JTAG Adapter Option #1: <a href="https://1bitsquared.com/products/black-magic-probe" target="_blank" rel="noreferrer">BlackMagic Probe</a>. Note, may come without cables (check with manufacturer). If so, you will need the <strong>Samtec FFSD-05-D-06.00-01-N</strong> cable (<a href="https://www.samtec.com/products/ffsd-05-d-06.00-01-n" target="_blank" rel="noreferrer">Samtec sample service</a> or <a href="http://www.digikey.com/product-search/en?x=0&amp;y=0&amp;lang=en&amp;site=us&amp;KeyWords=FFSD-05-D-06.00-01-N" target="_blank" rel="noreferrer">Digi-Key Link: SAM8218-ND</a>) or <a href="http://www.tag-connect.com/CORTEXRIBBON10" target="_blank" rel="noreferrer">Tag Connect Ribbon</a> and a Mini-USB cable.</li><li>JTAG Adapter Option #2: <a href="https://www.digikey.com/product-detail/en/stmicroelectronics/ST-LINK-V2/497-10484-ND" target="_blank" rel="noreferrer">Digi-Key Link: ST-LINK/V2</a> / <a href="http://www.st.com/internet/com/TECHNICAL_RESOURCES/TECHNICAL_LITERATURE/USER_MANUAL/DM00026748.pdf" target="_blank" rel="noreferrer">ST USER MANUAL</a>, needs an ARM Mini JTAG to 20pos adapter: <a href="https://www.digikey.com/en/products/detail/texas-instruments/MDL-ADA2/1986451" target="_blank" rel="noreferrer">Digi-Key Link: 726-1193-ND</a></li><li>JTAG Adapter Option #3: <a href="http://www.sparkfun.com/products/8278" target="_blank" rel="noreferrer">SparkFun Link: Olimex ARM-TINY</a> or any other OpenOCD-compatible ARM Cortex JTAG adapter, needs an ARM Mini JTAG to 20pos adapter: <a href="https://www.digikey.com/en/products/detail/texas-instruments/MDL-ADA2/1986451" target="_blank" rel="noreferrer">Digi-Key Link: 726-1193-ND</a></li></ul></li><li><strong>USARTs</strong>: Hirose DF13 6 pos (<a href="https://www.digikey.com/products/en?keywords=H3371-ND" target="_blank" rel="noreferrer">Digi-Key Link: DF13A-6P-1.25H(20)</a>) <ul><li>Mates: Hirose DF13 6 pos housing (<a href="https://www.digikey.com/products/en?keywords=H2182-ND" target="_blank" rel="noreferrer">Digi-Key Link: Hirose DF13-6S-1.25C</a>)</li></ul></li><li><strong>I2C and CAN</strong>: Hirose DF13 4 pos (<a href="https://www.digikey.com/en/products/detail/hirose-electric-co-ltd/DF13A-4P-1-25H-20/530666" target="_blank" rel="noreferrer">Digi-Key Link: DF13A-4P-1.25H(20)</a> - discontinued)</li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos.</p>',67),f=[u,b,m];function k(g,w,P,S,x,D){return c(),h("div",null,f)}const A=s(p,[["render",k]]);export{T as __pageData,A as default};
